import React from 'react'
import "../ftpage/ftpage.css";

function Fstpage() {
  return (
    <div className='fntbg'>
        <div><h1  c>Online shopping Hub</h1>
        <h2>Percentage Off: 10%,20%,30% off on minimum purchase.</h2>
        <h3>Combine related products at a discounted price.</h3>
        <h3>Limited-time discount on select products.</h3></div>
      
    </div>
  )
}

export default Fstpage
